import React from 'react'

export default function Spotify() {
  return (
    <div className='container'>
      <ul>
  <li><a href="default">Home</a></li>
  <li><a href="news.asp">Artist</a></li>
  <li><a href="contact.asp">Contact</a></li>
  <li><a href="about.asp">About</a></li>
</ul>
    </div>
  )
}
